#经纬度尺度KI：0.001(约100m)
KI = 0.0015

def compare_index(A, B, index, KI):
    return abs(A[index] - B[index]) <= KI
# 判断B[index]是否在A[index]的KI误差之内。

def calculate_distance(a, b):
    return a**2+b**2

# def simplified_distance(point1, point2):
#     return abs(point1[0]-point2[0])+abs(point1[1]-point2[1])

#观察发现路段划分以及导航结果顺序符合一定规律，以下这个函数基本能选到正确的路段
def point_within(lst, target, index, KI):
    for i in range(0, len(lst), 6):
        if i + 6 >= len(lst):
            if (lst[i][index] - KI < target[index] < lst[-1][index] + KI) or (lst[i][index] + KI > target[index] > lst[-1][index] - KI):
                return True
        else:
            if (lst[i][index] - KI < target[index] < lst[i+3][index] + KI) or (lst[i][index] + KI > target[index] > lst[i+3][index] - KI):
                return True


def brute_force(point_list, target):
    if not point_list:
        return None  # 如果列表为空，返回None

    closest_point = point_list[0]  # 初始化最近点为列表的第一个点
    min_distance = calculate_distance(point_list[0][0] - target[0], point_list[0][1] - target[1])  # 计算第一个点与目标点的距离

    for point in point_list[1:]:  # 遍历列表中的每个点（除了第一个）
        distance = calculate_distance(point[0] - target[0], point[1] - target[1])  # 计算当前点与目标点的距离
        if distance < min_distance:  # 如果找到更近的点，更新最近点和最小距离
            closest_point = point
            min_distance = distance

    return closest_point

#也可以加一个distance判断是否要尝试使用近似二分
def binary_search_path(path, target, index, KI):
    def is_ascending():
        return path[0][index] <= path[-1][index]

    ascending = is_ascending()

    left, right = 0, len(path) - 1
    while left <= right:
        mid = (left + right) // 2
        if compare_index(path[mid], target, index, KI):
            return mid
        if ascending:
            if path[mid][index] < target[index]:
                left = mid + 1
            else:
                right = mid - 1
        else:  # 如果路径是降序的
            if path[mid][index] > target[index]:
                left = mid + 1
            else:
                right = mid - 1

def find_closest_point(path, target):
    # 尝试在经度上使用二分搜索找到一个接近的点
    index = binary_search_path(path, target, 0, KI)

    if index:
        # 在找到的点附近查找满足条件的最接近点
        closest_point = path[index]
        min_distance = calculate_distance(target[0] - closest_point[0], target[1] - closest_point[1])
        for i in range(max(0, index-3), min(len(path), index+3)):
            if compare_index(path[i], target, 0, KI) and compare_index(path[i], target, 1, KI):
                distance = calculate_distance(target[0] - path[i][0], target[1] - path[i][1])
                if distance < min_distance:
                    min_distance = distance
                    closest_point = path[i]
        return closest_point
    else:
        return brute_force(path, target)


def find_path_and_calculate_midtime(AA, BB):
    times = []
    last_point = None
    last_index = -1
    last_point_index = 0
    for b in BB:
        found_path = None
        for a in AA:

            if point_within(a['path'], b, 0, 0.001) and point_within(a['path'], b, 1, 0.001):
                found_path = a
                break

        if found_path is None:
            times.append(None)
            continue

        closest_point = find_closest_point(found_path['path'], b)

        if closest_point is None:
            times.append(None)
            continue

        thistime = 0

        this_point_index = found_path['path'].index(b)
        total_index = len(found_path['path'])
        if last_index == AA.index(found_path):
            thistime =  (this_point_index - last_point_index) / total_index * found_path['time']
        else:
            if len(times) < len(BB)-1:
                # 这里可以总time减去前面之和
                thistime += this_point_index / (total_index-1) * found_path['time']
            if last_point:
                thistime += (len(AA[last_index]['path']) -1- last_point_index) / (len(AA[last_index]['path'])-1) * found_path['time']

            for a in AA[last_index+1:AA.index(found_path)]:
                thistime += a['time']

        times.append(thistime)
        last_point = closest_point
        last_index = AA.index(found_path)
        last_point_index = this_point_index

    return times



